VOICE_CONNECTION_STATE_VOICE_CONNECTED:"Discord on yhdistetty palvelimeesi **{hostname}** ja viiveen keskiarvo on **{averagePing}ms**. Viimeisin viivemittaus oli **{lastPing}ms**.\n\nJos viive ei ole tasainen tai enemmän kuin {badPing}ms, voit pyytää palvelimen omistajaa muuttamaan palvelimen sijaintia.",VOICE_CONNECTION_STATE_DISCONNECTED:"Hamsterit taisivat pudota pyöriltään. Discordin yhteys palvelimeesi on katkennut. Yritämme muodostaa yhteyden uudelleen hetken kuluttua.",TUTORIAL_SKIP:"Oletko jo ammattilainen? [Ohita ohjeet](onSkipClick)",TUTORIAL_CLOSE:"Asia ymmärretty!",CHANNEL_MUTE_TOOLTIP:"Kanavan mykistäminen estää ilmoitusten ja huomautusten näyttämisen, jollei sinua mainita.",SHOW_MUTED:"Näytä {n} mykistettyä",HIDE_MUTED:"Piilota {n} mykistettyä",WELCOME_MESSAGE_OWNER_TITLE:"Tervetuloa palvelimellesi, {username}!",WELCOME_MESSAGE_TITLE:"Tervetuloa palvelimelle, {username}!",WELCOME_MESSAGE_INSTANT_INVITE:"**Kutsu ystäväsi** tälle palvelimelle painamalla [jaa-painiketta](onShareClick), kun olet valmis.",WELCOME_MESSAGE_DESKTOP_APPS:"**Lataa** [työpöytäsovellus](onDownloadClick) päästaksesi nauttimaan Push-to-Talkista, pienemmästä tehon- sekä kaistankulutuksesta sekä monesta muusta.",WELCOME_MESSAGE_TUTORIAL:"**Opi lisää Discordista** omaan tahtiisi tutkimalla leijuvia tehtävämerkkejä.",WELCOME_MESSAGE_MOBILE_APPS:"**Pysy yhteydessä** palvelimeesi [älypuhelimellasi](onDownloadClick) ja käytä Discordia jopa pelatessasi konsolillasi.",WELCOME_MESSAGE_SUPPORT:"**Tavoita meidät** [tukipalvelumme]({supportURL}) kautta tai Twitterissä [@discordapp]({twitterURL}) mikäli sinulla on mitään kysyttävää tai tarvitset apua.",TIP_VOICE_CONVERSATIONS_TITLE:"Korota ääntäsi",TIP_VOICE_CONVERSATIONS_BODY:"Tämä on **ääniasetustesi paneeli.**\n\nKäytä näitä painikkeita mikrofonin mykistyksen poistamiseen, kuulokkeiden hiljentämiseen tai asetusten muokkaamiseen. Voit vaihtaa puhetilasi **Äänentunnistuksen ja Push-to-Talk:in** välillä ratasta painamalla.",TIP_WRITING_MESSAGES_TITLE:"Aloita keskustelu",TIP_WRITING_MESSAGES_BODY:"Täällä voit kirjoittaa kaikista mielipiteistäsi ja ideoistasi.\n\nJotta tämä olisi hauskempaa, lisäsimme tuen Markdown-syntaksille, joten voit helposti **esittää mielipiteesi** tai __tömistellä jalkojasi.__ Voit myös **vetää ja pudottaa** kuvia tai tiedostoja suoraan tänne jakaaksesi hienoimmat kissa-GIFisi. Älä kuitenkaan vallan innostu niiden kanssa.",TIP_ORGANIZE_BY_TOPIC_TITLE:"Järjestä kanavia ryhmittäin",TIP_ORGANIZE_BY_TOPIC_BODY:"",TIP_WHOS_ONLINE_TITLE:"Mitä pelaat?",TIP_WHOS_ONLINE_BODY:"Tämä lista näyttää ketkä ovat tällä kanavalla.\n\nTyöpöytäversiota käytettäessä näkyy myös käyttäjien senhetkinen pelitila. Painamalla käyttäjää näet **käyttäjäkohtaiset asetukset** kuten äänenvoimakkuuden säädöt sekä ylläpidollisia säätöjä.",TIP_INSTANT_INVITE_TITLE:"Kutsu kavereitasi",TIP_INSTANT_INVITE_BODY:"",TIP_SERVER_SETTINGS_TITLE:"Hallitse palvelintasi",TIP_SERVER_SETTINGS_BODY:"Klikkaa tästä päästäksesi palvelimesi asetuksiin.\n\nVoit muuttaa kaikennäköisiä asetuksia, esimerkiksi oikeuksia ja rooleja, valita palvelimesi sijainnin, luoda AFK-kanavan, hallita kutsumislinkkejä sekä käyttäjien porttikieltoja tai jopa poistaa palvelimesi.",TIP_DIRECT_MESSAGES_TITLE:"Aloita yksityiskeskustelu",TIP_DIRECT_MESSAGES_BODY:"Tällä listalla näet jokaisen käyttäjän jokaiselta palvelimeltasi.\n\nVoit keskustella yksityisesti valitsemasi käyttäjän kanssa. Yksityisviestit ovat mainio tapa saada yhteys käyttäjiin ilmoitusten avulla, vaikka he olisivat AFK-tilassa.",TIP_CREATE_MORE_SERVERS_TITLE:"Palvelimia, kaikkialla!",TIP_CREATE_MORE_SERVERS_BODY:"Paina tätä plus-painiketta luodaksesi uuden palvelimen.\n\nKoska palvelimet ovat ilmaisia, voit luoda niitä niin monta kuin haluat. Jokainen palvelin mahdollistaa ainutlaatuisen paikan erityyppisille käyttäjille. Kun et enää tarvitse niitä, voit myös poistaa ne.",TIP_CREATE_FIRST_SERVER_TITLE:"Luo oma palvelimesi",TIP_CREATE_FIRST_SERVER_BODY:"Tätä plussaa painamalla luot uuden oman palvelimen.\n\nJokainen palvelin luo uniikin paikan erityyppisille käyttäjille. Sen voi myös poistaa, kun sitä ei enää tarvita. Parasta kuitenkin on, että palvelimet ovat ilmaisia, joten voit luoda niitä niin monta kuin haluat.",TIP_FRIENDS_LIST_TITLE:"Näe kaverisi",TIP_FRIENDS_LIST_BODY:"Paina tästä nähdäksesi yksityisviestisi ja käyttäjien tilat kaikilla palvelimillasi. \n\nKun vastaanotat yksityisviestin, se ilmestyy tähän avatarisi alapuolelle.",BAN_USER_TITLE:"",BAN_USER_CONFIRMED:"",BAN_CONFIRM_TITLE:"",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Poista viestihistoria",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Älä poista mitään",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Edellisen 24 tunnin aikana",DELETE_MESSAGE_HISTORY_OPTION_7D:"Edellisen 7 päivän aikana",NO:"Ei",YES:"Kyllä",CLOSE:"Sulje",SEND:"Lähetä",CHOOSE:"Valitse",SAVE:"Tallenna",SELECT:"Valitse",START:"",ADD:"Lisää",SAVE_IMAGE_SUCCESS_MOBILE:"Kuva tallennettu!",SAVE_IMAGE_FAILURE_MOBILE:"Kuvan tallennus epäonnistui...",SAVE_IMAGE_FAILURE_HELP_MOBILE:"Tarkista verkon ja tietosuoja Järjestelmäasetusten kuvat-ohjelmalle.",NO_CAMERA_ACCESS:"Discordilla ei ole pääsyä kameraasi",NO_PHOTOS_ACCESS:"Discordilla ei ole pääsyä kuviisi",ENABLE_PRIVACY_ACCESS:"Voit ottaa pääsyn käyttöön yksityisyysasetuksista.",NO_PHOTO_IN_CAMERA_ROLL:"Ei kuvia kameran albumissa",DELETE_MESSAGE_BODY_MOBILE:"Oletko varma, että haluat poistaa tämän viestin? Tätä toimintoa ei voi perua.",JOIN_VOICE_CHANNEL:"Liitytäänkö tälle puhekanavalle?",LEAVE_SERVER_BODY_MOBILE:"Oletko varma, että haluat poistua palvelimelta {name}?",KICK_USER_TITLE:"Potki '{user}'",KICK_USER_BODY:"Oletko varma, että haluat potkia käyttäjän {user}? Hän voi liittyä takaisin uudella kutsulla.",KICK_USER_CONFIRMED:"",BAN_USER_BODY:"Oletko varma, että haluat antaa porttikiellon käyttäjälle {user} Hän ei voi liittyä takaisin, ennen kuin poistat porttikiellon.",VOICE_DISCONNECT_TITLE:"Puheyhteys katkaistu",VOICE_DISCONNECT_BODY:"Katkaistaanko yhteys tähän äänipalvelimeen?",JOIN_AFK_CHANNEL_B